import ContributeQuestions from "../../templates/ContributeQuestion/ContributeQuestions";
import dataForm from "../../api/dataform";
import { addQuestionDraft } from "../../store";
import { postQuestionDraft } from "../../api/fetchQuestion";
import route from "../../route";

export default class AddQuestionsPage {
  constructor() {}
  render() {
    const addQuestionDraftState = addQuestionDraft.get();
    return ContributeQuestions({
      fields: dataForm,
      buttonText: addQuestionDraftState.isLoading ? "Loading..." : "Submit",
      isAlertVisible: addQuestionDraftState.isAlert,
    });
  }
  _handleSubmit(event) {
    event.preventDefault();
    const formEL = document.getElementById("form-addquestion");
    const fieldEls = [...formEL.querySelectorAll(".field")];
    const inputTextGroupEls = [...formEL.querySelectorAll(".inputTextGroup")];
    const input = inputTextGroupEls.reduce((obj, inputTextGroupEl) => {
      const inputTextGroupItemEls = [
        ...inputTextGroupEl.querySelectorAll('input[type="text"]'),
      ];
      const name = inputTextGroupEl.getAttribute("data-name");
      const values = inputTextGroupItemEls.map((item) => {
        const radioEl = inputTextGroupEl.querySelector(
          `input[type="radio"][value="${item.name}"]`
        );
        return {
          value: `${item.name}: ${item.value}`,
          name: item.name,
          isCorrect: radioEl.checked,
        };
      });
      return {
        ...obj,
        [name]: values,
      };
    }, {});
    const getScore = (value) => {
      switch (value) {
        case "normal":
          return 500;
        case "hard":
          return 1000;
        case "easy":
        default:
          return 100;
      }
    };
    const result = fieldEls.reduce((obj, fieldEl) => {
      const { value, name } = fieldEl;
      return {
        ...obj,
        [name]: value,
        score: getScore(value),
        ...input,
      };
    }, {});
    addQuestionDraft.addQuestionRequest();
    postQuestionDraft(result).then((data) => {
      addQuestionDraft.addQuestionSuccess(data);
      const timeOut = setTimeout(() => {
        addQuestionDraft.resetAlert();
        clearTimeout(timeOut);
      }, 3000);
    });
  }
  _handleBackHomePage() {
    route.to("/");
  }
  handleDOM() {
    const buttonSubmitEl = document.querySelector("button[type='submit']");
    const buttonBackEl = document.querySelector("#back");
    if (buttonSubmitEl) {
      buttonSubmitEl.addEventListener("click", this._handleSubmit);
    }
    buttonBackEl &&
      buttonBackEl.addEventListener("click", this._handleBackHomePage);
  }
}
